package com.citi.retail.optima.etl.cache.model;

/**
 * @author mc56120
 *
 */
public class GeographyVO {

	private Integer geographyId;
	private Integer geographyCd;
	private String geographyName;
	private String geographyDesc;
	private Integer procUnitId;
	/**
	 * @return the geographyId
	 */
	public Integer getGeographyId() {
		return geographyId;
	}
	/**
	 * @param geographyId the geographyId to set
	 */
	public void setGeographyId(Integer geographyId) {
		this.geographyId = geographyId;
	}
	/**
	 * @return the geographyCd
	 */
	public Integer getGeographyCd() {
		return geographyCd;
	}
	/**
	 * @param geographyCd the geographyCd to set
	 */
	public void setGeographyCd(Integer geographyCd) {
		this.geographyCd = geographyCd;
	}
	/**
	 * @return the geographyName
	 */
	public String getGeographyName() {
		return geographyName;
	}
	/**
	 * @param geographyName the geographyName to set
	 */
	public void setGeographyName(String geographyName) {
		this.geographyName = geographyName;
	}
	/**
	 * @return the geographyDesc
	 */
	public String getGeographyDesc() {
		return geographyDesc;
	}
	/**
	 * @param geographyDesc the geographyDesc to set
	 */
	public void setGeographyDesc(String geographyDesc) {
		this.geographyDesc = geographyDesc;
	}
	/**
	 * @return the procUnitId
	 */
	public Integer getProcUnitId() {
		return procUnitId;
	}
	/**
	 * @param procUnitId the procUnitId to set
	 */
	public void setProcUnitId(Integer procUnitId) {
		this.procUnitId = procUnitId;
	}
	
	
	
}
